import React from 'react';
import ReactDOM from 'react-dom';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter , Route, Switch, Redirect } from "react-router-dom";
import Auth from "./layout/Auth";
import Home from "./views/dj/Home/Home";


import AuthLayout from "./layout/Auth.jsx";
import AgentLayout from "./layout/Agent.jsx";

ReactDOM.render(
  <BrowserRouter  
     history={history}>  
      <Switch>
        <Route  path='/Dj' render={props => <DjLayout {...props} />} />
        <Route  path='/auth'  render={props => <AuthLayout {...props} />} />
        <Route  path='/agent'  render={props => <AgentLayout {...props} />} />
        <Route  path='/' render={props => <DjLayout {...props} />} />
        <Redirect from="/" to="/" />

      </Switch>
    </BrowserRouter>,
  document.getElementById('root')
);
reportWebVitals();
